import Layout from '../../components/Layout';

const FragmentLink = props => (
    <Link href={`/fragments?title=${props.title}`}>
        <a>{props.title}</a>
    </Link>
);

export default function About() {
    return (
        <Layout>
            <div>
                <p>Une liste de fragments</p>
            </div>
        </Layout>
    );
}
